void display(void)
{  
	  for(int hang=0;hang<SCAN_TYPE;hang++)
	  {
			uint8_t dat;
			for(int ts=0;ts<MAX_BIT;ts++)
			{
			 for(int i=0;i<128;i++)
			 {
				 dat = 0;
				 if((Buffer_RGB[1*arrD1 + (16+hang)*arrD2 + i] & (1<<ts)) != 0 ){dat|=(0x01<<G2);} //ghi bit 7 G2 
				 if((Buffer_RGB[1*arrD1 + (0+hang)*arrD2 + i]  & (1<<ts)) != 0 ){dat|=(0x01<<G1);} //ghi bit 0 G1
				 if((Buffer_RGB[0*arrD1 + (0+hang)*arrD2 + i]  & (1<<ts)) != 0 ){dat|=(0x01<<R1);} //ghi bit 1 R1
				 if((Buffer_RGB[2*arrD1 + (0+hang)*arrD2 + i]  & (1<<ts)) != 0 ){dat|=(0x01<<B1);} //ghi bit 4 B1
				 if((Buffer_RGB[0*arrD1 + (16+hang)*arrD2 + i] & (1<<ts)) != 0 ){dat|=(0x01<<R2);} //ghi bit 6 R2
				 if((Buffer_RGB[2*arrD1 + (16+hang)*arrD2 + i] & (1<<ts)) != 0 ){dat|=(0x01<<B2);} //ghi bit 9 B2
				 Buffer_GPIO[hang*MAX_BIT*128 + ts*128 + i]=dat;
			 }
			} 
		}
}
void ngatquetled(void)
{
  __HAL_TIM_SET_COMPARE(&htim2,TIM_CHANNEL_2,0);
	
  for(int i=0;i<128;i++)
	{
		data_PORT->ODR=Buffer_GPIO[scan_data[hang_led]*MAX_BIT*128 +vitri_bit*128 + i];
		clk_P->BSRR=(1<<(clk+16));clk_P->BSRR=(1<<clk);
	}	 	
		
	__HAL_TIM_SET_COMPARE(&htim2,TIM_CHANNEL_2,scan_PWM_duty[vitri_bit]);
	
	scan16S(scan_data[hang_led]);
	Control_P->BSRR=(1<<LAT); // chot data
	Control_P->BSRR=(1<<(LAT+16));
	
	vitri_bit++;
	if(vitri_bit==MAX_BIT){vitri_bit=0;hang_led++;if(hang_led==SCAN_TYPE)hang_led=0;}	
}
